    east_vals = {'N': min(X, 3 * Y), 'S': min(Y, 3 * X), 'E': 0, 'W': min(2 * Y, 2 * X)}
    west_vals = {'N': min(Y, 3 * X), 'S': min(X, 3 * Y), 'W': 0, 'E': min(2 * Y, 2 * X)}
    sm1 = sum((east_vals[S[i]] for i in range(N)))
    sm2 = 1
    ans = sm1
    for i in range(N - 1, -1, -1):
        ans = min(ans, sm1 + sm2)
        sm1 -= east_vals[S[i]]
        sm2 += west_vals[S[i]]
    ans = min(ans, sm1 + sm2)
    return ans

